import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open mobile menu
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_opened.png'));

    // Click on 'Your Orders'
    await page.waitForSelector('a:has-text("Your Orders")', { timeout: 5000 });
    await page.click('a:has-text("Your Orders")');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_your_orders_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_your_orders_clicked.png'));

    // Click on 'Your Profile'
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_your_profile_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_your_profile_clicked.png'));

    // Close mobile menu
    await page.waitForSelector('.close-mobile-menu', { timeout: 5000 });
    await page.click('.close-mobile-menu');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_mobile_menu_closed.png'));

    return {
      success: true,
      action: "Tested mobile menu navigation successfully",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
